  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:21.840052\",\n\t\"name\": \"klamath-bird-observatorys-contribution-to-the-usfws-western-colonial-waterbird-survey-summ\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Colonial nesting waterbirds concentrate
  in areas of suitable nesting habitat. This aggregated spatial distribution means
  local environmental changes such as water fluctuation, water quality, predation,
  disturbance, or food availability can rapidly affect a proportionately high percentage
  of the population. The North American Waterbird Conservation Plan (NAWCP) states
  that 80% of waterbirds are colonial nesting species and one-third of those are at
  risk of serious population loss (Kushlan et al. 2002). Theplan calls for a regional
  approach to monitoring and conservation and states that the conservation assessment
  of waterbird populations is dependent upon collecting more information on population
  size, trends, and the relative importance of specific sites.At the regional level,
  the population statuses of western colonial waterbirds are not well understood and
  the Intermountain West Waterbird Conservation Plan, the regional stepdown plan for
  the NAWCP, expresses the need for additional baseline information to better inform
  management and implement conservation (Ivey and Herziger 2006). Both Regions 1 and
  8 of the U.S. Fish and Wildlife Service (USFWS) Migratory Bird Program have identified
  Oregon as a priority for periodic monitoring of colonial waterbird populations.\",\n\t\"license_title\":
